import React from 'react';
import Slider from 'react-slick';
import s from './Portfolio.module.css';
import review1 from '../../reviewsImage/review1.png';
import review2 from '../../reviewsImage/review2.png';
import review3 from '../../reviewsImage/review3.png';
import review4 from '../../reviewsImage/review4.png';
const Portfolio = ()=>{
    let settings = {
        dots:false,
        infinite:true,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'79px'
    };
    return(
        <div className={s.portfolioSlider}>
<Slider {...settings}>
<div>
    <img src={review1}></img>
</div>
<div>
<img src={review2}></img>
</div>
<div>
<img src={review3}></img>
</div>
<div>
<img src={review4}></img>
</div>
</Slider>
</div>
    );
};

export default Portfolio;
